const IntroSection = props => {

    return(
        <div className={classes.container}>
            <div className={classes.writeup}>
                <h2 className={classes.headline}>Manage your daily tasks with TaskPlanr</h2>
                <p>Effortlessly manage your tasks and boost 
                    productivity with our intuitive task management website.
                    <br></br>
                Stay organized, collaborate seamlessly, and accomplish more with ease.</p>
            </div>

            

        </div>




    );


}

export default IntroSection;
